블러그 닉네임은 아프리칸 팍스(African fox)입니다.
아프리카에서 여행사 & 게스트 하우스 운영 경험을 바탕으로 광주 송정역에 조아 게스트 하우스를 오픈하게 되었습니다.  1층 & 2층 아프리카 소품으로  깨끗하고 아늑하게 준비 하였으니 편히 쉬었다 가세요. 광주 송정역 조아 게스트 하우스에 오시면 제가 아프리카 10개국을 여행하며 수집한 독특한 아프리카 토속 공예품이 전시되어 있습니다. 이색적이고 독특한  아프리카를 경험 할 수 있는 특별한 여행이 될 것입니다. 

북부 아프리카 이집트에서 커피의 왕국 에티오피아, 동물의 왕국인 케냐 & 탄자니아, 세계 3대 폭포 중 하나인 빅토리아 폭포의 도시 짐바브웨와 잠비아, 사라진 호수 오카방고 델타 삼각주와 부시맨이 살고 있는 보츠와나, 세계에서 가장 아름다운 붉은 사막투어를 볼 수 있는  나미비아, 아프리카 속 유럽인 남아공 케이프 타운에서 수집한 아프리카 전통 토속 기념품도 구경할 수 있는 광주송정역 조아 게스트 하우스에서 쉬었다 가세요.', '수원여자대학교', null, null, null, null, null, null, null, null, null, null, 0, 0),
