        (1544, '9362d69f-f61d-4f0f-9137-9f26710dc71d', 1, 1, '2016-09-09 23:48:41.182', '숙소 소개: 우리 집은 사람이 아닙니다. 

제 남편과 저는 불충분한 조화를 이루는 로맨틱한 커플입니다. 우리는 35년 이상 결혼했습니다.
